import React from 'react';
import "./home.css"

const HomePage = () => {
  return (
    <div className="homeContainer">
        <div className="firstCurve"></div>
        <div className="secondCurve"></div>
        <div className="mainContent">
            <div className="textIntroduction"></div>
            div.options
        </div>
    </div>
  )
}

export default HomePage
